// <
void Prelude__LT_hnf(field root)
{
  debug(LOW, "HNF <:\n");
  debug_expr(LOW, root);
  field v2;
  v2 = child_at(root, 0);
  {
    bool nondet = false;
    field scrutinee = v2;
    while(true)
    {
      nondet |= scrutinee.n->nondet;
      switch(scrutinee.n->symbol->tag)
      {
        case FAIL_TAG:
        {
          if(nondet)
          {
            save(root, make_Prelude__LT_(v2, 0));
          }
          fail(root);
          debug(LOW, "leaving <\n");
          debug_expr(LOW, root);
          return;
        }
        case FUNCTION_TAG:
        {
          HNF(scrutinee);
          break;
        }
        case CHOICE_TAG:
        {
          choose(scrutinee);
          break;
        }
        case FORWARD_TAG:
        {
          scrutinee = scrutinee.n->children[0];
          break;
        }
        case FREE_TAG:
        {
          push_frame(scrutinee, free_var());
          set_Prelude__USDict_HTOrd_free(scrutinee);
          nondet = true;
          break;
        }
        case Prelude__USDict_HTOrd_TAG:
        {
          if(nondet)
          {
            save(root, make_Prelude__LT_(v2, 0));
          }
          field v3;
          field v4;
          field v5;
          field v6;
          field v7;
          field v8;
          field v9;
          field v10;
          v10 = child_at(scrutinee, 0);
          v9 = child_at(scrutinee, 1);
          v8 = child_at(scrutinee, 2);
          v7 = child_at(scrutinee, 3);
          v6 = child_at(scrutinee, 4);
          v5 = child_at(scrutinee, 5);
          v4 = child_at(scrutinee, 6);
          v3 = child_at(scrutinee, 7);
          set_forward(root, v7);
          debug(LOW, "leaving <\n");
          debug_expr(LOW, root);
          return;
        }
      }
    }
  }
}

